script: |
  super -f text -I q10845.spq | sort > q10845.out

inputs:
  - name: q10845.spq
    data: |
      SELECT DISTINCT + col1 + tab1.col0 / col1 AS col0 FROM tab1 (FORMAT parquet) WHERE ( col2 * - col2 / + col1 + + col1 + tab1.col0 ) <> NULL;
  - name: tab1

outputs:
  - name: q10845.out
    data: |
